  `created_at` datetime DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL,
  `category_id` int(10) unsigned DEFAULT NULL,
  `main` tinyint(11) unsigned NOT NULL DEFAULT '0',
  `key` tinyint(11) unsigned NOT NULL DEFAULT '0',
  `author_id` int(10) unsigned DEFAULT NULL,
  `author_name` varchar(500) DEFAULT NULL,
  `views` int(10) unsigned NOT NULL DEFAULT '0',
  `redactor_id` int(10) unsigned DEFAULT NULL,
  `allow_comments` int(11) DEFAULT '1',
  `meta_title` varchar(500) DEFAULT NULL,
  `meta_description` text,
  `meta_keywords` text,
  `file` int(10) unsigned DEFAULT NULL,
  `audio` int(11) unsigned DEFAULT NULL,
  `video` varchar(500) DEFAULT NULL,
  `photo_place` varchar(500) DEFAULT NULL,
  `photo_author` varchar(500) DEFAULT NULL,
  `main_time_start` datetime DEFAULT NULL,
  `main_time_end` datetime DEFAULT NULL,
  `type` int(10) unsigned DEFAULT NULL,
  `tags` varchar(1000) DEFAULT NULL,
  `comments` int(11) DEFAULT NULL,
  `reporter` tinyint(1) unsigned NOT NULL,
  `sub_main` tinyint(1) DEFAULT NULL,
  `editor` text,
  `infograph` int(11) unsigned DEFAULT NULL COMMENT 'Файл инфографики',
  `audio_duration` int(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `category_id` (`category_id`) USING BTREE,
  KEY `id` (`id`) USING BTREE,
  KEY `sef` (`sef`(255)) USING BTREE,
  KEY `date` (`date`) USING BTREE,
  KEY `created_at` (`created_at`) USING BTREE,
  KEY `lang_3` (`lang`,`status`,`date`) USING BTREE,
  KEY `lang_2` (`lang`,`status`,`type`,`date`) USING BTREE,
  KEY `status` (`category_id`,`lang`,`status`) USING BTREE,
  KEY `lang` (`key`,`main`,`lang`,`status`,`date`) USING BTREE,
  KEY `status_2` (`status`,`lang`,`main`,`main_time_start`,`main_time_end`,`date`) USING BTREE,
  KEY `key` (`key`,`main`,`lang`,`status`,`category_id`,`id`) USING BTREE,
  KEY `lang_4` (`lang`,`status`,`category_id`) USING BTREE,
  CONSTRAINT `news_ibfk_1` FOREIGN KEY (`category_id`) REFERENCES `categories` (`id`) ON DELETE SET NULL ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8;
