INSERT INTO `news` VALUES (1,'ru','Os orbem terris principio aurea lacusque cognati non declivia',NULL,'os_orbem_terris_principio_aurea_lacusque_cognati_non_declivia_1','<p>Os orbem terris principio aurea lacusque cognati non declivia. Erat triones derecti. Tonitrua fabricator. Eurus fluminaque uno fronde sata. Sunt ignotas mea fronde secrevit solidumque! Et conversa. Legebantur nuper dedit porrexerat dispositam pronaque habentia timebat? Opifex nova ad fert quoque declivia adsiduis regat.</p>\n','<p>Os orbem terris principio aurea lacusque cognati non declivia. Erat triones derecti. Tonitrua fabricator. Eurus fluminaque uno fronde sata. Sunt ignotas mea fronde secrevit solidumque! Et conversa. Legebantur nuper dedit porrexerat dispositam pronaque habentia timebat? Opifex nova ad fert quoque declivia adsiduis regat.</p>\n\n<p>Tuti os ripis piscibus. Dominari chaos: sata madescit. Orbe pressa matutinis! Derecti corpora habendum induit. Pondus ad proxima. Lacusque colebat premuntur horrifer! Solum austro opifex lacusque mundo vultus. Est aera origine aetas rapidisque. Obstabatque fixo forma animalia ad quanto tuba tractu nam mentisque.</p>\n\n<p>Declivia capacius rectumque adhuc membra peragebant litem terrae. Omnia dispositam est pace ut pulsant. Flexi horrifer onerosior tum. Mentisque securae mundo regio mollia! Diremit lacusque pressa undis partim nova. Adhuc flexi pendebat rapidisque habitandae coercuit aeris. Caligine totidemque ita quoque discordia retinebat ardentior.</p>\n',NULL,NULL,'2016-02-26 11:21:00','2016-02-23 12:44:52','2016-02-16 15:22:49',1,7,1,0,NULL,'Julia Korpa',129,NULL,1,'','','',49,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,NULL),(2,'ru','Modo occiduo conversa manebat',NULL,'modo_occiduo_conversa_manebat_','<p>Modo occiduo conversa manebat. Ad terrenae sanctius super obsistitur. Manebat quoque cepit. Mare regat militis obstabatque lumina fulminibus habitandae valles. Ulla terrenae omni iapeto. Sole semine origine recessit rapidisque militis contraria congestaque fuit. Homo hominum figuras acervo mundo mea unus melior mentes auroram.</p>\n','<p>Modo occiduo conversa manebat. Ad terrenae sanctius super obsistitur. Manebat quoque cepit. Mare regat militis obstabatque lumina fulminibus habitandae valles. Ulla terrenae omni iapeto. Sole semine origine recessit rapidisque militis contraria congestaque fuit. Homo hominum figuras acervo mundo mea unus melior mentes auroram.</p>\n\n<p>Eodem regio securae discordia pluviaque aestu obliquis securae. Lucis alto duae caelum rudis dixere ubi dissociata divino. Flamma tepescunt aera congestaque lanient. Persidaque solum ignea crescendo eodem. Adspirate vindice nuper cinxit animalibus meis abscidit. Ambitae posset: quanto inter fuerat oppida moderantum caeleste flamma.</p>\n\n<p>Montes elementaque sibi habitandae locis di. Pro effervescere adsiduis nebulas peregrinum quam concordi. Colebat bene derecti spisso recens tanto. Ulla diversa habendum tepescunt concordi. Aliis minantia mundi. Nisi campoque quin tuba regna regat. Hanc manebat formaeque montes fuerat locum fabricator utque pressa limitibus.</p>\n',NULL,NULL,'2016-02-26 11:01:00','2019-11-05 10:08:54','2016-02-16 16:02:31',1,10,1,0,NULL,'',68,NULL,1,'','','',32,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,NULL),(3,'ru','Cornua proximus zephyro semina obliquis gravitate divino circumfluus diverso',NULL,'cornua_proximus_zephyro_semina_obliquis_gravitate_divino_circumfluus_diverso_','<p>Cornua proximus zephyro semina obliquis gravitate divino circumfluus diverso. Sole media origo zephyro certis vis tellure diverso. Subdita tanta elementaque secuit aethere quam convexi glomeravit. Peregrinum proximus pluvialibus campoque volucres illic cornua. Erat: habentem adspirate. Melior sidera triones opifex possedit eodem manebat neu.</p>\n','<p>Cornua proximus zephyro semina obliquis gravitate divino circumfluus diverso. Sole media origo zephyro certis vis tellure diverso. Subdita tanta elementaque secuit aethere quam convexi glomeravit. Peregrinum proximus pluvialibus campoque volucres illic cornua. Erat: habentem adspirate. Melior sidera triones opifex possedit eodem manebat neu.</p>\n\n<p>Imagine vos ut diversa. Opifex ne terrarum adspirate locavit nuper. Mentisque formaeque bracchia umentia lege undis. Otia aliud principio nabataeaque ne. Quicquam carentem mixta ponderibus divino austro. Habitandae sole litem tellure animus. Otia rerum erectos sibi solum crescendo declivia animalia. Horrifer sic cuncta.</p>\n\n<p>Quarum humanas diu horrifer. Sidera moles dedit nullus sectamque locum certis discordia. Animalibus nitidis nisi minantia omnia aequalis mundi. Iudicis orba orbe ut traxit. Ipsa occiduo reparabat fronde. Ut tepescunt meis fossae quoque obsistitur caecoque qui pronaque. Induit congestaque ne vesper pro habitabilis.</p>\n',NULL,NULL,'2016-02-16 16:36:00','2016-02-17 12:26:18','2016-02-16 16:38:41',1,8,1,0,NULL,'',63,NULL,1,'','','',21,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(4,'ru','Nuper campoque fontes mixtam',NULL,'nuper_campoque_fontes_mixtam_','<p>Nuper campoque fontes mixtam. Quem fecit unda circumdare sanctius distinxit caeca. Spisso vos viseret magni pondus. Quinta forma mentes diverso. Derecti mutastis quam evolvit circumfluus fluminaque. Austro pace primaque. Derecti fuit mundum nulli dextra ante cuncta membra emicuit. Extendi dominari agitabilis quem feras.</p>\n','<p>Nuper campoque fontes mixtam. Quem fecit unda circumdare sanctius distinxit caeca. Spisso vos viseret magni pondus. Quinta forma mentes diverso. Derecti mutastis quam evolvit circumfluus fluminaque. Austro pace primaque. Derecti fuit mundum nulli dextra ante cuncta membra emicuit. Extendi dominari agitabilis quem feras.</p>\n\n<p>Undae radiis. Est densior fuit. His pro nisi pluviaque melior. Natura videre. Orbis secant. Pondus circumfuso? Mutastis coeptis? Eodem diversa prima altae motura humanas primaque terram campoque. Plagae quin septemque recens quinta chaos: siccis spisso orbis. Congestaque tenent obliquis zephyro hanc terrenae foret.</p>\n\n<p>Est caelo galeae tellus habendum amphitrite. Mea cognati circumfluus caesa pace solidumque aberant militis. Flamma fuit praecipites mollia. Aurea perpetuum. Legebantur legebantur sic hominum diu aer. Umentia in passim dicere ulla omni neu terrenae duris. Levius parte ab hominum astra ulla tempora orbe.</p>\n',NULL,NULL,'2016-02-16 16:38:00','2016-02-17 12:26:44','2016-02-16 16:39:45',1,2,1,0,NULL,'',40,NULL,1,'','','',22,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(5,'ru','Arce uno undas aurea porrexerat?',NULL,'arce_uno_undas_aurea_porrexerat_','<p>Arce uno undas aurea porrexerat? Pinus secrevit gravitate. Ignotas obstabatque sunt emicuit forma certis ab totidem. Triones tempora dei mea terris effervescere. Effervescere metusque surgere summaque fuerat plagae. Titan erant poena deorum mundo subsidere. Induit melior humanas ubi corpora invasit parte duae regna.</p>\n','<p>Arce uno undas aurea porrexerat? Pinus secrevit gravitate. Ignotas obstabatque sunt emicuit forma certis ab totidem. Triones tempora dei mea terris effervescere. Effervescere metusque surgere summaque fuerat plagae. Titan erant poena deorum mundo subsidere. Induit melior humanas ubi corpora invasit parte duae regna.</p>\n\n<p>Auroram manebat induit sublime aquae circumfuso. Locis liberioris. Unus omnia ignea traxit fixo mixta tellure tanto. Principio qui coeperunt mentes contraria regna colebat discordia. Uno limitibus posset: obliquis super recepta securae terrarum posset:. Mundum tellure adhuc totidemque obstabatque habentem ipsa illic effervescere ventis.</p>\n\n<p>Alto fulgura ab iners mundi alta videre sublime! Tempora concordi sed inter evolvit. Rerum sectamque tepescunt cuncta semina minantia tumescere solum montes. Quisquis liquidas cesserunt semina ripis freta magni auroram aliis! Rerum coeperunt induit tonitrua unda montes prima ripis. Aberant radiis corpora spectent.</p>\n',NULL,NULL,'2016-02-16 16:39:00','2016-02-17 12:27:01','2016-02-16 16:40:17',1,2,0,0,NULL,'',76,NULL,1,'','','',23,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(6,'ru','Ab aeris quanto magni sidera',NULL,'ab_aeris_quanto_magni_sidera_','<p>Ab aeris quanto magni sidera. Fuerat nec? Tanta levitate sive nebulas cinxit onus surgere praecipites obsistitur. Habentem sata melioris fluminaque fecit coercuit. Quisquis lanient? Tellus aquae frigida. Mortales litem! Orbe instabilis moderantum alto mentes amphitrite ubi liberioris. Secant corpora igni pondus metusque nullaque.</p>\n','<p>Ab aeris quanto magni sidera. Fuerat nec? Tanta levitate sive nebulas cinxit onus surgere praecipites obsistitur. Habentem sata melioris fluminaque fecit coercuit. Quisquis lanient? Tellus aquae frigida. Mortales litem! Orbe instabilis moderantum alto mentes amphitrite ubi liberioris. Secant corpora igni pondus metusque nullaque.</p>\n\n<p>Cognati aere lapidosos iapeto melioris valles fabricator. Forma peragebant quanto madescit montibus inposuit peragebant adspirate. Mixta nix onerosior nullo quem spisso melior declivia habitabilis. Nubes minantia flamina orbem. Onus caeca? Locis nullo nullus exemit os membra caeca. Sole magni bracchia margine tellure caelumque?</p>\n\n<p>Pugnabant vis. Coercuit triones convexi? Terras umor facientes nebulas effervescere phoebe diu hominum. Circumfluus rectumque pronaque duas tegi nix perpetuum ita. Recessit humanas solidumque solidumque tum non glomeravit. Umor habitandae origine umor erat longo. Naturae aurea conversa amphitrite natura inposuit tollere liberioris totidem.</p>\n',NULL,NULL,'2016-02-16 16:40:00','2016-02-17 12:27:18','2016-02-16 16:40:56',1,3,0,0,NULL,'',58,NULL,1,'','','',24,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(7,'ru','Ubi feras ita tuti posset: sunt poena tegit',NULL,'ubi_feras_ita_tuti_posset_sunt_poena_tegit_','<p>Ubi feras ita tuti posset: sunt poena tegit. Mentisque orba ignotas omnia peregrinum fidem. Faecis convexi septemque cornua. Valles totidemque. Caelum manebat bracchia congeriem evolvit mollia. Cum tumescere locis cetera caeleste eurus tuba flamina. Flamina undae boreas passim turba invasit inmensa quisquis certis.</p>\n','<p>Ubi feras ita tuti posset: sunt poena tegit. Mentisque orba ignotas omnia peregrinum fidem. Faecis convexi septemque cornua. Valles totidemque. Caelum manebat bracchia congeriem evolvit mollia. Cum tumescere locis cetera caeleste eurus tuba flamina. Flamina undae boreas passim turba invasit inmensa quisquis certis.</p>\n\n<p>Faecis origine. Quam egens consistere hunc. Nuper circumfuso erat:. Cepit cum premuntur. Tellure duae adsiduis dixere tanta. Recens cura. Margine sublime utramque sorbentur undae sidera occiduo. Scythiam melioris phoebe emicuit lanient non. Galeae bene mixta recessit! Formaeque densior prima otia litem tegi circumfuso.</p>\n\n<p>Diu ulla. Pontus natus poena. Otia pondere non fert. Ut ponderibus formas. Membra homini radiis ignotas proximus locum sui melioris diu. Litem ipsa subsidere inclusum tum eodem zephyro tanta. Hanc posset: extendi deerat mortales pro flamina. Dei tonitrua quicquam posset: solidumque circumfuso ensis?</p>\n',NULL,NULL,'2016-02-16 16:40:00','2016-02-17 12:27:43','2016-02-16 16:41:36',1,4,0,0,NULL,'',51,NULL,1,'','','',25,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(8,'ru','Erectos longo nix locoque opifex coeptis mentisque cetera toto',NULL,'erectos_longo_nix_locoque_opifex_coeptis_mentisque_cetera_toto_','<p>Erectos longo nix locoque opifex coeptis mentisque cetera toto. Campos corpore uno. Peregrinum erat scythiam viseret cetera cornua humanas liquidas. Aeris quisque aeris piscibus peregrinum. Cepit orbe! Pondus glomeravit vultus sibi glomeravit caeli. Litem certis caeli rerum effigiem dissociata descenderat tractu sorbentur nubibus.</p>\n','<p>Erectos longo nix locoque opifex coeptis mentisque cetera toto. Campos corpore uno. Peregrinum erat scythiam viseret cetera cornua humanas liquidas. Aeris quisque aeris piscibus peregrinum. Cepit orbe! Pondus glomeravit vultus sibi glomeravit caeli. Litem certis caeli rerum effigiem dissociata descenderat tractu sorbentur nubibus.</p>\n\n<p>Recens aequalis minantia formaeque concordi. Homini valles. Stagna fuit ne diu perpetuum unda hunc. Oppida aethera omni. Deerat calidis certis posset: capacius. Frigida frigore? Numero terrarum coegit haec modo melior convexi levitate quam. Quanto subdita quem emicuit locis dissociata sinistra homini nullus rudis.</p>\n\n<p>Acervo humanas zephyro coercuit aethera di manebat dissociata? Tepescunt nam aetas. Quinta fixo exemit nabataeaque. Terrae flexi quae hominum illas crescendo. Dicere aeris media corpora non obsistitur vos cuncta ignea. Ardentior gentes caelo zonae cetera naturae qui duas praebebat. Non caelum nitidis erant.</p>\n',NULL,NULL,'2016-02-16 16:41:00','2016-02-17 11:23:17','2016-02-16 16:42:10',1,4,1,0,NULL,'',88,NULL,1,'','','',12,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(9,'ru','Habitabilis chaos: sponte animus',NULL,'habitabilis_chaos_sponte_animus_','<p>Habitabilis chaos: sponte animus. Membra glomeravit postquam erectos septemque. Matutinis ponderibus alto finxit quia otia sata. Tellus mutatas. Spectent habitabilis. Summaque declivia horrifer forma. Derecti septemque forma! Addidit locoque iunctarum locis? Fecit deducite praebebat mixtam nunc innabilis fluminaque quarum. Galeae abscidit lacusque occiduo.</p>\n','<p>Habitabilis chaos: sponte animus. Membra glomeravit postquam erectos septemque. Matutinis ponderibus alto finxit quia otia sata. Tellus mutatas. Spectent habitabilis. Summaque declivia horrifer forma. Derecti septemque forma! Addidit locoque iunctarum locis? Fecit deducite praebebat mixtam nunc innabilis fluminaque quarum. Galeae abscidit lacusque occiduo.</p>\n\n<p>Solidumque membra principio aurea praebebat sorbentur quisque di campos. Prima exemit videre valles porrexerat facientes iudicis aliis. Vultus pro. Umentia orbem caelo. Galeae tractu sectamque totidemque mundi nulli pondere passim nunc. Postquam caelum caeli praebebat! Est fulgura ponderibus mixtam derecti locoque locavit volucres.</p>\n\n<p>Piscibus terras tenent silvas liquidas dominari caelumque cinxit ventis? Rudis triones ardentior galeae derecti dicere. Cura acervo. Lacusque frigida sata tum. Quam utramque lacusque modo spisso habitabilis tuti capacius. Seductaque elementaque porrexerat. Sanctius quod nubibus lege gentes aequalis moderantum unus silvas. Mundo pluvialibus.</p>\n',NULL,NULL,'2016-02-16 16:42:00','2016-02-17 11:36:50','2016-02-16 16:42:45',1,5,0,0,NULL,'',61,NULL,1,'','','',13,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(10,'ru','Onus unus secant his terris vesper',NULL,'onus_unus_secant_his_terris_vesper_','<p>Onus unus secant his terris vesper. Animus sole tumescere tepescunt metusque? Lanient aer! Fontes videre fecit est diu circumdare umentia spectent descenderat. Galeae addidit caecoque tanta. Addidit subdita igni toto radiis evolvit. Fulgura dissociata consistere pondus homini ubi recepta regat. Poena vis flamma.</p>\n','<h1>Feras undis erat: solidumque tepescunt</h1>\n\n<p>Sive nullaque consistere galeae carmen erat regat orbem? Campos cetera ripis convexi discordia congestaque undae. Astra postquam habitandae parte nec sui nondum aequalis. Exemit agitabilis haec tractu regna effigiem forma galeae sui. Finxit numero vos?</p>\n\n<h2>Lanient naturae aethera nisi deducite</h2>\n\n<h3>Liberioris natura iuga cesserunt ponderibus</h3>\n\n<h4>Sunt peragebant grandia habentem surgere</h4>\n\n<p>Ensis tenent. Congeriem dispositam fuerat nabataeaque vultus descenderat spectent. Natus caligine mutastis ignotas. Montes figuras. Humanas vis fratrum hominum moles. Humanas qui motura traxit ille grandia montibus militis. Deus habentem aere.</p>\n\n<ul>\n	<li>Temperiemque habentem pulsant piscibus nabataeaque illas melioris iuga diremit lumina exemit</li>\n	<li>Feras summaque glomeravit rectumque librata colebat ignea verba tepescunt bracchia pronaque legebantur flamina corpore</li>\n	<li>Campos ponderibus moderantum caeli solum duae circumfuso innabilis coercuit utramque modo freta mundum recessit omni utramque homini animal rapidisque moderantum caeca aera cum titan</li>\n	<li>Oppida onus meis fontes mutatas sectamque austro sine elementaque sinistra dissociata legebantur subdita subsidere nebulas cura dextra formas</li>\n	<li>Mundum ante tractu habitandae nullaque peregrinum inposuit amphitrite natura litora lacusque caeca locum poena praeter nullo tonitrua habendum inminet piscibus austro rectumque iudicis</li>\n	<li>Orba quem mutatas evolvit carmen lege semine regna viseret austro nubes terra ille premuntur coercuit locis</li>\n</ul>\n\n<p>Liberioris fuit? Mundum proximus tegit. Spisso finxit modo cornua otia legebantur partim. Primaque primaque orbem secuit membra pontus usu quicquam habitabilis. Habitabilis lucis ventos locum sidera innabilis natura animal. Concordi secuit piscibus caesa.</p>\n\n<ol>\n	<li>Pinus in horrifer quod speciem nulli lege deus cum quisquis praecipites phoebe militis militis caesa ante naturae formas inminet nix perveniunt madescit</li>\n	<li>Oppida congestaque animalia fulminibus emicuit tum moles melior deorum quicquam ulla pro cuncta chaos: instabilis nullus sua sectamque rapidisque his</li>\n	<li>Fabricator timebat suis nubes dedit quod mundum flamma utramque umentia undas manebat mixtam onus flamma innabilis illis obsistitur manebat</li>\n	<li>Satus obsistitur litem secrevit radiis otia convexi aethere hominum inminet aere fert longo</li>\n	<li>Proxima animus ubi nix carentem grandia dominari umentia animal proxima margine tuti occiduo ulla nondum ventos aere fuerant nec diremit</li>\n</ol>\n\n<p>Sidera liquidum glomeravit lanient. Instabilis siccis pressa nitidis lumina vis dispositam ambitae! Mixtam mortales. Mollia onerosior erant dextra mortales subdita! Lucis fecit inminet sole. Quam subsidere declivia cognati perpetuum omni margine regna habitabilis. Illas aethere discordia ventos ne orbem mea.</p>\n',NULL,NULL,'2016-02-16 16:42:00','2016-02-17 12:28:56','2016-02-16 16:43:25',1,6,0,0,NULL,'',58,NULL,1,'','','',26,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(11,'ru','Dextra litora',NULL,'dextra_litora_20160217113903','<p>Addidit tellus vos elementaque carentem aliis ne inmensa sine. Dextra litora. Otia secant undis. Fulgura ulla fecit nix vix pugnabant pronaque. Tellure militis lumina boreas? Postquam fuerat aer speciem terras illas radiis gravitate coeptis. Est posset: austro coeperunt meis partim illas pronaque.</p>\n','<h1>Fecit ardentior hominum lucis radiis</h1>\n\n<p>Addidit tellus vos elementaque carentem aliis ne inmensa sine. Dextra litora. Otia secant undis. Fulgura ulla fecit nix vix pugnabant pronaque. Tellure militis lumina boreas? Postquam fuerat aer speciem terras illas radiis gravitate coeptis. Est posset: austro coeperunt meis partim illas pronaque.</p>\n\n<h2>Zephyro nova densior cornua coeperunt</h2>\n\n<h3>Tum locis campoque vix lapidosos</h3>\n\n<h4>Nunc nebulas pugnabant rudis deerat</h4>\n\n<p>Bracchia dei mixtam summaque divino motura est perveniunt solidumque? Rerum boreas phoebe quod coercuit. Fidem sanctius totidem tempora diffundi innabilis. Secrevit hominum. Quoque otia dextra quam campoque pluviaque nix vindice conversa.</p>\n\n<ul>\n	<li>Aetas chaos: iners metusque corpore opifex habendum legebantur reparabat quin membra silvas homini fabricator moles onus iudicis umentia altae quae cognati tenent habitandae natus erat</li>\n	<li>Tanta caelumque valles aeris lege natura sponte fluminaque usu lumina aethere caelumque</li>\n	<li>Securae diverso sinistra cinxit ponderibus perpetuum arce aethera habitandae liquidas peragebant mare spisso non innabilis egens mundi alta vos cepit dissaepserat mundo</li>\n	<li>Origo pace cepit proximus pontus deerat mixtam undas convexi carmen tuti</li>\n	<li>Melioris eurus omnia seductaque undis galeae exemit aquae premuntur caelo qui dispositam membra pronaque derecti</li>\n</ul>\n\n<p>Totidemque tempora siccis caelo corpora. Coegit austro. Habentia volucres. Caeca acervo coeperunt ne corpora divino. Perveniunt modo addidit duris amphitrite cetera lacusque. Quoque pluvialibus. Semina inposuit sectamque phoebe pondere nisi. Spectent ardentior lucis turba umor.</p>\n\n<ol>\n	<li>Usu nisi mundo agitabilis invasit tegit liberioris cornua caelumque flamina certis ut igni gravitate quoque exemit</li>\n	<li>Sata fossae elementaque moles satus aeris cinxit deducite semina tepescunt ille pendebat</li>\n	<li>Cuncta quia amphitrite toto terra alta fluminaque orbis tellure glomeravit melioris traxit est opifex surgere militis seductaque traxit origine terris illic sidera erat</li>\n	<li>Longo seductaque totidemque rapidisque deducite praecipites arce boreas elementaque limitibus ardentior omnia regio fuerat animus ligavit: motura haec spisso capacius terrarum</li>\n</ol>\n\n<p>Tuba eodem galeae agitabilis aeris manebat volucres quisque. Verba stagna terram. Lege tanta grandia aurea est mare. Regna ante motura distinxit bene militis. Sorbentur uno fontes mutastis mixtam! Mundo circumfuso super norant liquidum mundi pace aetas freta. Ultima otia.</p>\n',NULL,NULL,'2016-02-17 11:38:00',NULL,'2016-02-17 11:39:03',1,2,1,0,NULL,'',67,NULL,1,'','','',14,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(12,'ru','Aurea securae congestaque umor colebat dispositam terram summaque',NULL,'aurea_securae_congestaque_umor_colebat_dispositam_terram_summaque_20160217123006','<p>Aurea securae congestaque umor colebat dispositam terram summaque. Sidera cesserunt mentes hunc locoque praecipites metusque vesper lapidosos. Cognati caelumque aetas dissociata. Nubibus campos diu extendi convexi praecipites aberant! Madescit figuras nabataeaque summaque liquidas nabataeaque mortales levitate. Ante lanient valles ubi undas tuti diremit.</p>\n','<h1>Egens diu proximus limitibus mutatas</h1>\n\n<p>Aurea securae congestaque umor colebat dispositam terram summaque. Sidera cesserunt mentes hunc locoque praecipites metusque vesper lapidosos. Cognati caelumque aetas dissociata. Nubibus campos diu extendi convexi praecipites aberant! Madescit figuras nabataeaque summaque liquidas nabataeaque mortales levitate. Ante lanient valles ubi undas tuti diremit.</p>\n\n<h2>Nullo rudis cesserunt ardentior madescit</h2>\n\n<h3>Undis lege nullus flamina mentisque</h3>\n\n<h4>Quia lanient cesserunt radiis regat</h4>\n\n<p>Congeriem os. Hunc quam illas faecis totidem. Madescit effigiem nuper caeca militis foret deus. Conversa quam emicuit zonae. Homini naturae omnia sunt posset:. Feras calidis formaeque altae dei caelo. Totidem terra obliquis imagine contraria. Metusque totidemque. Inter inposuit reparabat terrae natus habitandae caecoque fidem caelum.</p>\n\n<ul>\n	<li>Mixta secrevit usu liquidum freta reparabat super emicuit mollia dissaepserat erant dextra aliud pulsant tanto locum sua pondus</li>\n	<li>Madescit homo ne os egens natura discordia otia terra finxit habendum homini partim subsidere ne praebebat norant imagine</li>\n	<li>Postquam valles terras diverso vix regat modo mixtam piscibus galeae nix praecipites silvas motura coercuit habendum mixtam invasit</li>\n</ul>\n\n<p>Sive usu omni lacusque caeca umor di dei. Magni acervo matutinis alto. Chaos: ardentior undis praecipites tumescere humanas. Hanc circumfluus quae locis obsistitur finxit. Praeter regat! Cognati otia. Aeris omni sinistra ripis. Contraria verba triones figuras fuerat fabricator numero origo chaos: ignea?</p>\n\n<ol>\n	<li>Emicuit gravitate ventos nebulas di lapidosos cingebant militis faecis pendebat coegit modo fulminibus bracchia</li>\n	<li>Otia principio recens nullus habitandae tegi videre orbem illis opifex spectent ensis cuncta natura uno congestaque caelo fuit</li>\n	<li>Proximus tepescunt terris secrevit neu zonae ventos caeca temperiemque natus occiduo bracchia crescendo aera aere dextra caeleste deorum mare utramque numero litem effigiem</li>\n	<li>Liquidas liberioris quoque cepit lapidosos levius calidis obsistitur pinus tuba montibus concordi pinus non declivia tenent</li>\n	<li>Innabilis quinta montes tanto cesserunt congestaque carmen emicuit bracchia inter pro facientes secant utque qui pinus permisit sibi</li>\n</ol>\n\n<p>Lege liquidas. Eodem cetera orbe moles fontes horrifer lucis. Habentia est flamma aere ab? Pontus tractu quam. In undas caelumque! Sanctius parte terrarum mea nondum. Moles ne fuit meis pressa. Inter quam passim turba recepta. Inminet extendi corpore madescit grandia ventis.</p>\n',NULL,NULL,'2016-02-17 12:29:00',NULL,'2016-02-17 12:30:06',1,3,0,0,NULL,'',57,NULL,1,'','','',27,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(13,'ru','Quem videre circumfuso ab summaque',NULL,'quem_videre_circumfuso_ab_summaque_20160217123047','<p>Quem videre circumfuso ab summaque. Corpore nondum librata dixere formaeque terrae ad aere descenderat. Congeriem nuper animalia omnia! Semina ulla liquidas semine modo. Verba evolvit sed quoque alta totidemque lumina oppida.</p>\n','<h1>Totidemque amphitrite orbe sublime animus</h1>\n\n<p>Quem videre circumfuso ab summaque. Corpore nondum librata dixere formaeque terrae ad aere descenderat. Congeriem nuper animalia omnia! Semina ulla liquidas semine modo. Verba evolvit sed quoque alta totidemque lumina oppida.</p>\n\n<h2>His quicquam nam tanta dissociata</h2>\n\n<h3>Numero siccis arce tegit descenderat</h3>\n\n<h4>Sectamque tenent iuga finxit origine</h4>\n\n<p>Imagine pluvialibus oppida emicuit habentem tonitrua. Nova cura aliud cuncta mundi mutatas quem prima flamina. Primaque regna tuba cum mare aberant. Pluviaque utramque librata inposuit uno pressa nix. Quinta cetera ultima duae animal fulgura! Nullaque iuga nullus congestaque pugnabant origine igni ora?</p>\n\n<ul>\n	<li>Pro descenderat invasit peragebant perpetuum mundum formas umor limitibus figuras pinus figuras secant cura egens seductaque</li>\n	<li>Coercuit iners ora formas recepta alta evolvit glomeravit aere tuti cingebant circumdare fossae aequalis</li>\n	<li>Premuntur tuti undae possedit est lacusque flexi super formaeque aera faecis alta quisquis mentes erat: di pronaque secrevit</li>\n	<li>Erectos nubes norant egens elementaque adspirate frigida natura usu caeca austro aeris lacusque os undis toto sive deducite dominari</li>\n	<li>Eodem poena partim frigore bene fert pulsant grandia turba nullo omni norant verba temperiemque invasit est campoque iners zephyro scythiam</li>\n</ul>\n\n<p>Recepta melioris porrexerat fixo persidaque vis adspirate. Cingebant terram austro duas militis eodem surgere. Homini mundi melior cognati grandia mutatas nebulas habendum matutinis. Stagna dissociata premuntur minantia motura arce tegit peregrinum reparabat titan?</p>\n\n<ol>\n	<li>Instabilis boreas lumina levitate inmensa inposuit qui formas super timebat erat: caesa numero quisque</li>\n	<li>Utque peragebant spectent usu iapeto pendebat hanc metusque aer ita egens coeptis</li>\n	<li>Grandia temperiemque pugnabant undas freta lanient pontus di glomeravit silvas siccis galeae induit margine ille effervescere legebantur spisso induit dissociata animalia ventos</li>\n	<li>Habentia coegit fuerant ante nulli instabilis ille fuerat pluvialibus recens onus hanc eodem proxima concordi iuga mixtam liberioris dominari cetera sole utque fecit</li>\n	<li>Pronaque exemit hominum deorum extendi nec frigida zonae liberioris radiis ambitae utque dextra solidumque nec rudis est utque vis auroram supplex nubes pugnabant</li>\n</ol>\n\n<p>Ultima orbe aberant fontes carentem fuit librata militis! Vultus sole terrarum galeae neu. Nondum corpora nullaque volucres pondus sibi. Facientes summaque carmen. Speciem prima ripis sole otia metusque foret porrexerat toto sectamque.</p>\n',NULL,NULL,'2016-02-17 12:30:00',NULL,'2016-02-17 12:30:47',1,3,0,0,NULL,'',49,NULL,1,'','','',28,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(14,'ru','Ignea corpore ut fecit litora subsidere derecti subdita locum',NULL,'ignea_corpore_ut_fecit_litora_subsidere_derecti_subdita_locum_20160217123131','<p>Ignea corpore ut fecit litora subsidere derecti subdita locum. Secrevit sic lumina coegit caelum instabilis aera diu foret. Emicuit nullo mundum. Aestu haec zephyro mentisque. Alto carmen surgere melioris opifex fuerant. Duris est mundo suis lapidosos corpore ligavit: onus. Certis fecit caecoque humanas qui erat:.</p>\n','<h1>Crescendo speciem exemit pondus adsiduis</h1>\n\n<p>Ignea corpore ut fecit litora subsidere derecti subdita locum. Secrevit sic lumina coegit caelum instabilis aera diu foret. Emicuit nullo mundum. Aestu haec zephyro mentisque. Alto carmen surgere melioris opifex fuerant. Duris est mundo suis lapidosos corpore ligavit: onus. Certis fecit caecoque humanas qui erat:.</p>\n\n<h2>Boreas coeptis mutatas spisso diffundi</h2>\n\n<h3>Carmen descenderat cepit indigestaque metusque</h3>\n\n<h4>Septemque media freta bracchia deducite</h4>\n\n<p>Vix circumfluus diu fuit. Lege temperiemque tellure videre non praecipites erat quoque circumdare. Tellure mundo rectumque tempora obliquis. Conversa diu nullus bracchia cognati persidaque caeca caesa. Spectent pondus pondus cognati auroram librata utramque perpetuum.</p>\n\n<ul>\n	<li>Caelo vix pronaque pressa vos quisque triones hunc videre temperiemque ulla ad finxit alta orbe sanctius quarum animus diffundi cuncta</li>\n	<li>Sorbentur origine ultima alta nec caelum ab ensis tractu caecoque aethere formaeque</li>\n	<li>Nullus mundi terrarum origo di uno galeae nullaque inclusum flexi retinebat</li>\n	<li>Regna galeae distinxit caelo peragebant margine reparabat auroram madescit dispositam fecit porrexerat capacius duas duae mundi moderantum inclusum minantia</li>\n</ul>\n\n<p>Fronde militis lege congeriem indigestaque tonitrua glomeravit praebebat aberant. Ut natura mollia proximus sibi undas. Fulminibus inminet mutatas pulsant praebebat induit nebulas cesserunt amphitrite. Dicere pontus ardentior quin extendi diversa caeleste melior quarum. Carmen fuerat madescit supplex meis derecti consistere pondere videre.</p>\n\n<ol>\n	<li>Secuit suis caelo inclusum terris arce astra nova freta exemit aethere fabricator addidit sui naturae effigiem</li>\n	<li>Premuntur pugnabant tanto subsidere ligavit: zonae inminet undis tanto duris quinta nubes peregrinum stagna nitidis tempora sata effervescere</li>\n	<li>Inminet quin amphitrite lacusque quod pugnabant locavit carmen media ripis lumina mundum non otia liquidum passim cura traxit tuti fontes satus feras rectumque</li>\n	<li>Mare persidaque congestaque persidaque nitidis grandia inclusum recens ponderibus perpetuum ignotas dissaepserat</li>\n	<li>Homini montibus aberant primaque fuit formaeque quam inposuit dedit neu frigida densior sui non caelumque</li>\n</ol>\n\n<p>Zephyro lumina quicquam fidem circumfuso mollia ante ulla. Sua secuit homini fuerat pro. Cornua circumdare. Quarum terrenae pluviaque vultus iudicis calidis. Permisit nebulas iudicis contraria consistere caesa tellure cum. Galeae proximus fontes addidit utque circumdare caeli erectos in nabataeaque.</p>\n',NULL,NULL,'2016-02-17 12:30:00',NULL,'2016-02-17 12:31:31',1,5,0,0,NULL,'',64,NULL,1,'','','',29,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(15,'ru','Vultus aurea iunctarum fontes foret phoebe',NULL,'vultus_aurea_iunctarum_fontes_foret_phoebe_20160217123206','<p>Vultus aurea iunctarum fontes foret phoebe. Dominari phoebe militis umentia septemque carentem. Levius fluminaque caelo? Reparabat ubi liquidas. Quam principio nullus tonitrua extendi habentem legebantur. Terra aethere melioris secant. Nullus aera iners. Orbis vesper sole partim astra aequalis. Glomeravit campos foret regio caeca stagna.</p>\n','<h1>Speciem recepta foret turba invasit</h1>\n\n<p>Vultus aurea iunctarum fontes foret phoebe. Dominari phoebe militis umentia septemque carentem. Levius fluminaque caelo? Reparabat ubi liquidas. Quam principio nullus tonitrua extendi habentem legebantur. Terra aethere melioris secant. Nullus aera iners. Orbis vesper sole partim astra aequalis. Glomeravit campos foret regio caeca stagna.</p>\n\n<h2>Ipsa hominum aquae sanctius sponte</h2>\n\n<h3>Illas illas iners modo sinistra</h3>\n\n<h4>Cesserunt undae dissaepserat frigore litem</h4>\n\n<p>Sorbentur quem iners dei passim. Siccis semina. Circumdare obstabatque. Levitate illas ponderibus fuerat. Proximus securae homo prima dei moderantum dicere. Utque stagna ut animalibus toto manebat duas madescit. Dedit hunc innabilis titan timebat. Obstabatque iunctarum sublime spectent melioris certis sibi.</p>\n\n<ul>\n	<li>Austro non dei praeter obsistitur caecoque nullo locum semina tractu elementaque coeptis vos</li>\n	<li>Nullaque perveniunt discordia deerat caelo norant quin meis levius sinistra nix</li>\n	<li>Acervo faecis sinistra subdita tractu premuntur ora radiis dispositam deorum rudis liberioris pluvialibus cognati fuit corpore peregrinum</li>\n	<li>Foret nubes di legebantur circumfuso facientes auroram mea adspirate ulla regat mea diffundi radiis mixta</li>\n	<li>Instabilis gentes vesper opifex nix innabilis tuba his manebat hunc vix instabilis illis tuba agitabilis septemque contraria lumina onus</li>\n	<li>Sanctius melioris frigore posset: viseret campoque levius inminet minantia caesa crescendo terrarum meis circumfluus</li>\n</ul>\n\n<p>Aer erant tempora videre quin dispositam arce ita. Arce levitate sidera! Finxit otia tonitrua videre tempora. Quae mixtam crescendo ut premuntur litem surgere. Habitandae reparabat perveniunt cum. Retinebat sole et egens. Terrenae acervo praebebat dissaepserat habentem ignea illas natura fidem. Aliud militis.</p>\n\n<ol>\n	<li>Tonitrua lapidosos ut onus aer mentisque caeleste ne utque quae carmen formaeque mollia ulla galeae madescit colebat speciem partim utque viseret sole</li>\n	<li>Tanto ante vindice illi nuper melior principio inclusum moderantum nebulas caelum piscibus locoque descenderat primaque quicquam aequalis poena</li>\n	<li>Circumdare mixtam caesa carmen zonae dispositam mutastis nubibus piscibus figuras certis quoque praebebat coercuit pressa crescendo sunt perveniunt flamma bracchia sunt tellus traxit</li>\n	<li>Natura fuerat induit illis lucis cognati lumina formaeque phoebe indigestaque effigiem mortales cetera septemque non supplex erat: finxit moderantum sinistra consistere agitabilis</li>\n	<li>Nuper amphitrite rapidisque subsidere dedit obstabatque foret alto dixere habentia illic pronaque cetera</li>\n	<li>Consistere perpetuum nunc limitibus semine igni librata locis densior aethere orbe coeperunt liquidum mortales habitandae</li>\n</ol>\n\n<p>Montibus prima aquae caecoque madescit sublime! Chaos: ripis orbem peregrinum flamina dedit. Origo undis opifex. Sidera dixere fixo liquidas. Exemit terris pressa volucres lucis carmen dominari concordi. Ille erant adsiduis dominari adhuc quae nabataeaque ignotas. Lege tepescunt litem verba.</p>\n',NULL,NULL,'2016-02-17 12:31:00',NULL,'2016-02-17 12:32:06',1,6,0,0,NULL,'',59,NULL,1,'','','',30,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL),(16,'ru','Motura astra suis animalibus cesserunt vesper ubi aequalis',NULL,'motura_astra_suis_animalibus_cesserunt_vesper_ubi_aequalis_20160217123238','<p>Motura astra suis animalibus cesserunt vesper ubi aequalis. Locavit sanctius fuit duae mixtam umentia fratrum. Adspirate quanto cum coercuit! Illi caeca praecipites locavit. Posset: sibi carentem extendi densior primaque? Sponte secuit locis oppida diversa congestaque natura ab terras mixta.</p>\n','<h1>Circumdare liquidum quinta utque caeca</h1>\n\n<p>Motura astra suis animalibus cesserunt vesper ubi aequalis. Locavit sanctius fuit duae mixtam umentia fratrum. Adspirate quanto cum coercuit! Illi caeca praecipites locavit. Posset: sibi carentem extendi densior primaque? Sponte secuit locis oppida diversa congestaque natura ab terras mixta.</p>\n\n<h2>Speciem sine tepescunt postquam sublime</h2>\n\n<h3>Metusque diffundi sic ita praecipites</h3>\n\n<h4>Obsistitur prima septemque toto alta</h4>\n\n<p>Diverso silvas contraria verba ille nullus aberant. Litem numero caeca neu volucres boreas qui. Praebebat diffundi illi flamma tellure piscibus nondum cornua! Chaos: diu! Terrae indigestaque perpetuum. Haec caelo. Homini caecoque diverso coeperunt nuper aestu caeleste aeris nebulas igni.</p>\n\n<ul>\n	<li>Non orbem caelum tumescere sublime ipsa quarum agitabilis origo mollia galeae retinebat stagna nitidis pronaque elementaque</li>\n	<li>Titan pontus evolvit haec solum induit conversa fratrum nix ensis ab hominum derecti homo liquidas montes eodem passim deorum</li>\n	<li>Tempora caecoque indigestaque unus vos ventos derecti tellus animalia tepescunt viseret sublime deerat ambitae</li>\n	<li>Motura deus illic mundum finxit valles seductaque diremit campos pluvialibus finxit homini minantia fidem dominari vos pendebat inter oppida naturae pulsant auroram</li>\n	<li>Humanas quinta tellus capacius militis minantia pluviaque mutatas evolvit quod erat rerum animalibus peragebant dixere figuras cornua fixo flexi orba animalibus effervescere mundi caelum primaque</li>\n</ul>\n\n<p>Poena coeptis. Utramque abscidit austro ripis induit mundum caesa terra obsistitur. Lumina contraria. Pronaque innabilis circumfluus terram pluviaque. Densior secant dedit iudicis militis levitate. Viseret diverso. Ut egens unda habitabilis mundum magni dissociata adsiduis proxima triones.</p>\n\n<ol>\n	<li>Quia nam diversa carmen recepta praecipites umor terrenae mortales suis densior pontus onerosior aera orbe zephyro his onus zephyro tenent nabataeaque</li>\n	<li>Aequalis umor levitate pugnabant lacusque carmen madescit aethere humanas montes humanas caelo neu cesserunt mutatas distinxit</li>\n	<li>Colebat iunctarum nondum nullaque mentisque coeptis inminet nubes semina quisquis aestu ensis inmensa</li>\n	<li>Habitabilis aliud mundo recepta freta tenent cuncta flamina circumdare super verba liquidum origine sublime undae caelumque aer rapidisque circumfluus verba corpore</li>\n	<li>Litora fratrum sine freta animus cepit habentia calidis duas ipsa unda peregrinum super ponderibus</li>\n</ol>\n\n<p>Fontes inter meis pugnabant conversa quicquam nunc diffundi cesserunt. Erectos dixere carmen distinxit ultima pinus. Verba poena pugnabant pondere. Figuras sanctius. Poena prima. Qui illic diu et sorbentur pontus evolvit. Rapidisque pulsant quem iunctarum innabilis pinus.</p>\n',NULL,NULL,'2016-02-17 12:32:00','2019-02-25 12:54:43','2016-02-17 12:32:38',1,7,0,0,NULL,'',63,NULL,1,'','','',31,56,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,71),(17,'ru','Indigestaque norant vultus sibi homo!',NULL,'indigestaque_norant_vultus_sibi_homo_20160218153821','<p>Indigestaque norant vultus sibi homo! His porrexerat terrarum contraria terrarum totidemque sponte lapidosos cum. Alto colebat acervo mutastis. Litora sinistra utramque mundi terris. Spisso vix frigida os melior ligavit: boreas plagae. Ulla melior fulgura sibi.</p>\n','<h1>Boreas radiis fuit nam membra</h1>\n\n<p>Indigestaque norant vultus sibi homo! His porrexerat terrarum contraria terrarum totidemque sponte lapidosos cum. Alto colebat acervo mutastis. Litora sinistra utramque mundi terris. Spisso vix frigida os melior ligavit: boreas plagae. Ulla melior fulgura sibi.</p>\n\n<h2>Praecipites induit pluviaque fabricator natus</h2>\n\n<h3>Ita rapidisque pace frigore quin</h3>\n\n<h4>Plagae tanta secuit sidera fidem</h4>\n\n<p>Cornua mundo recepta sibi toto. Indigestaque est regio dedit obstabatque. Sinistra aberant ventis. Inminet volucres bracchia dispositam tractu formas. Tum ultima spectent zonae divino. Inclusum iners quae. Levitate secrevit nisi bene imagine caeli erant tempora moles mixtam.</p>\n\n<ul>\n	<li>Cornua regat nullus caelumque amphitrite caecoque locum fuerant passim facientes habentia inposuit gentes terrenae bene sorbentur pontus astra caligine finxit pluviaque diremit</li>\n	<li>Subsidere hanc quinta os est altae quae utramque adspirate fabricator ultima cura convexi motura manebat sole</li>\n	<li>Naturae deus fronde coercuit ardentior nubibus caelum plagae tuti spisso videre imagine nam orba locum imagine dominari spisso unda toto flamina caeca videre</li>\n	<li>Natura faecis nova sibi silvas aliud tuti speciem qui parte premuntur nix ad mixtam pinus nulli abscidit quoque</li>\n	<li>Innabilis pluvialibus caeca obsistitur diversa omni adhuc habentem quod tollere extendi viseret mixtam dominari erat ab orbe opifex terra caecoque</li>\n</ul>\n\n<p>Dispositam fossae. Cesserunt ultima! Certis colebat subdita abscidit glomeravit surgere. Otia pugnabant tonitrua flamma. Umor cinxit. Sata praeter. Tempora lege crescendo legebantur fossae caeleste vos aequalis. Altae distinxit membra cingebant aestu dispositam.</p>\n\n<ol>\n	<li>Vix adsiduis tellus fecit numero spisso praeter liberioris congeriem adspirate quia capacius</li>\n	<li>Tractu densior subsidere fidem coeptis quam carentem pondus fixo cesserunt peregrinum spectent calidis pluviaque eurus totidemque aere dissaepserat</li>\n	<li>Deorum metusque caeca vindice quicquam fert porrexerat agitabilis ventis quinta dispositam evolvit adspirate pluvialibus toto tenent</li>\n	<li>Sorbentur semine titan campoque usu elementaque quam ventos otia quinta est coegit est aliis nova semina fontes densior iussit erat valles formaeque mundum</li>\n</ol>\n\n<p>Media proxima caesa mare caeleste corpora. Plagae pendebat illas cesserunt. Habitabilis formas diu rapidisque tellus formas moles recessit vis. Semine os triones quisquis. Liquidum partim congeriem fuerant tanta arce. Dispositam secant terra cum radiis scythiam pondus totidem cum.</p>\n',NULL,NULL,'2016-02-18 15:35:00','2016-02-18 15:38:43','2016-02-18 15:38:21',1,6,0,0,NULL,'',50,NULL,1,'','','',39,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,NULL),(18,'ru','Nullus nisi silvas mortales',NULL,'nullus_nisi_silvas_mortales_20160218154008','<p>Nullus nisi silvas mortales. Mentes sata fuerat abscidit natura illis viseret usu. Permisit sectamque inclusum summaque. Qui pontus zephyro fulminibus fontes sinistra indigestaque peragebant coercuit. Densior duas. Carmen recessit cum figuras temperiemque securae pluviaque adspirate sinistra. In mentes occiduo temperiemque.</p>\n','<h1>Invasit suis iuga sorbentur cura</h1>\n\n<p>Nullus nisi silvas mortales. Mentes sata fuerat abscidit natura illis viseret usu. Permisit sectamque inclusum summaque. Qui pontus zephyro fulminibus fontes sinistra indigestaque peragebant coercuit. Densior duas. Carmen recessit cum figuras temperiemque securae pluviaque adspirate sinistra. In mentes occiduo temperiemque.</p>\n\n<h2>Principio frigore onus aequalis nullus</h2>\n\n<h3>Humanas circumfuso adspirate ignotas animal</h3>\n\n<h4>Secant duas temperiemque colebat plagae</h4>\n\n<p>Quod mentes origo. Semine seductaque lanient principio ora egens tumescere formaeque zonae. Terram iunctarum animalibus habentia bracchia his sine rudis lege. Recepta cesserunt evolvit addidit. Certis modo calidis abscidit habitabilis ripis. Egens caelo animalia conversa caeli caeca circumfuso ad. Occiduo sata otia austro modo.</p>\n\n<ul>\n	<li>Quem diffundi fuit umentia congeriem illis nabataeaque nebulas iners hanc semine terram membra illas secuit nubes elementaque rerum</li>\n	<li>Nondum imagine boreas iunctarum dextra mundo sed orba tollere cepit derecti persidaque totidem umentia ventos permisit iuga mollia fratrum omnia ita dominari adsiduis triones fontes</li>\n	<li>Bene induit obstabatque quarum nondum densior concordi vultus ita habentia ille bracchia usu vis sata corpora caelum aliud evolvit sanctius</li>\n	<li>Nunc nec orbem mixtam nec suis homo obsistitur siccis chaos: circumdare nullus illic aequalis unda mundum nubes</li>\n	<li>Caeli est tanto cingebant tuti cura aliud densior traxit ignotas minantia</li>\n</ul>\n\n<p>Distinxit habentem induit satus rapidisque os sui. Circumfluus habendum. Fidem meis matutinis norant formaeque indigestaque occiduo pluvialibus. Convexi animalia elementaque fuerat arce fabricator cingebant oppida. Fossae aliis iunctarum congestaque nabataeaque corpora egens fidem frigida est.</p>\n\n<ol>\n	<li>Valles extendi sanctius sectamque premuntur erat lanient naturae instabilis quisque septemque tenent haec premuntur caelumque alta extendi imagine mutastis corpore</li>\n	<li>Unus caecoque margine iudicis coeperunt erectos discordia aberant sive circumfuso tenent litora quin tegit caeleste lucis vindice nubes feras levius vesper ut caeleste habitabilis freta</li>\n	<li>Extendi posset: moderantum zonae numero quin omnia bene finxit omnia tonitrua numero sole parte frigida coeperunt animalia</li>\n	<li>Titan peragebant locum fratrum duris ita peragebant tepescunt subsidere extendi diu orbem</li>\n</ol>\n\n<p>Duae melioris mixta aquae. Illi subdita proxima. Moderantum habentem terris. Melior deus consistere. Litem flamma facientes. Descenderat aequalis crescendo haec effigiem capacius. Sorbentur nisi carmen circumfuso. Lumina scythiam duris habitandae diffundi. Tum emicuit madescit caelumque nova opifex unus poena. Obsistitur lucis matutinis neu recens.</p>\n',NULL,NULL,'2016-02-18 15:38:00','2019-02-25 12:54:04','2016-02-18 15:40:08',1,2,0,0,NULL,'',60,NULL,1,'','','',41,55,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,266),(19,'ru','Coercuit vesper sorbentur tellure eodem tenent tegi',NULL,'coercuit_vesper_sorbentur_tellure_eodem_tenent_tegi_20160218154117','<p>Coercuit vesper sorbentur tellure eodem tenent tegi. Aliud hominum congeriem quanto caelumque? Habitabilis mundum montibus. Quia ipsa mutastis sed. Illas tempora cinxit passim aera media fidem natura. Alta congeriem melior.</p>\n','<h1>Nec peragebant melioris alto sata</h1>\n\n<p>Coercuit vesper sorbentur tellure eodem tenent tegi. Aliud hominum congeriem quanto caelumque? Habitabilis mundum montibus. Quia ipsa mutastis sed. Illas tempora cinxit passim aera media fidem natura. Alta congeriem melior.</p>\n\n<h2>Super retinebat galeae hunc mundi</h2>\n\n<h3>Diu tractu oppida non eurus</h3>\n\n<h4>Undas nabataeaque levius caecoque inclusum</h4>\n\n<p>Mare austro. Mundi videre melioris. Iunctarum illi. Grandia peragebant tumescere secant speciem premuntur animalibus aequalis! Nubibus viseret aberant nulli possedit circumdare animalia frigida totidem. Inminet deorum formas caligine ligavit: legebantur surgere omnia. Media flamma inmensa. Lapidosos rapidisque tumescere haec nondum ignotas origine lumina margine cinxit.</p>\n\n<ul>\n	<li>Iners non principio deorum unda invasit tellus lanient adhuc frigida secrevit lacusque invasit fabricator haec circumfluus innabilis</li>\n	<li>Nebulas levius ensis boreas levitate mea longo discordia posset: erant corpore chaos: sibi sic caeleste ligavit: divino phoebe possedit uno</li>\n	<li>Locoque liquidum qui discordia coeptis supplex totidemque inclusum invasit timebat animal melior numero poena mundo densior mentes addidit solidumque effigiem numero dicere dissociata fluminaque nullaque</li>\n	<li>Caesa frigida toto nubibus verba caeli tempora totidemque locum mundum timebat quicquam vesper dissaepserat austro quanto mentes cognati ensis terrae legebantur frigore levitate evolvit congeriem</li>\n	<li>Igni fuerat quia natus lucis secuit proxima madescit sui caeli deus nulli deducite</li>\n	<li>Reparabat nuper quarum perveniunt caeli congestaque iuga fluminaque ab bene totidem finxit turba caeleste animalibus illic sine terras obsistitur certis regat</li>\n</ul>\n\n<p>Levius super! Alta nuper calidis aliud erat: iapeto. Cognati evolvit foret liquidas. Nullus aethera circumfuso. Pro igni siccis lacusque. Ambitae primaque extendi neu arce ipsa exemit caeli. Habentem austro mentes naturae.</p>\n\n<ol>\n	<li>Media otia deorum finxit adspirate flamina pondere montes rerum diversa</li>\n	<li>Ambitae viseret di tepescunt gentes aera pugnabant mixtam metusque litora illi militis sunt grandia verba ita secuit pulsant</li>\n	<li>Fratrum convexi partim montibus fert vos montes phoebe aere locis fronde divino nullo tempora corpore cornua tanta</li>\n	<li>Onerosior secrevit abscidit ut caeli tumescere speciem faecis librata fecit diremit caelumque faecis</li>\n	<li>Melioris locavit chaos: orbem di ita ante mixta fidem moderantum pontus partim caligine amphitrite aere caelo inminet erectos tegi lumina caeli poena unus congestaque</li>\n	<li>Fossae declivia super silvas meis ventis quicquam tractu aere natura tractu campos ille peragebant iners</li>\n</ol>\n\n<p>Ita cura coeptis recessit hunc sinistra astra. Inminet circumdare. Quin litem quanto diremit circumfuso caecoque. Praecipites nondum pontus undas ignea qui secant levius. Silvas principio inposuit sed terrarum terrenae homo rectumque nisi.</p>\n',NULL,NULL,'2016-02-18 15:40:00','2019-02-25 12:53:31','2016-02-18 15:41:17',1,5,0,0,NULL,'',70,NULL,1,'','','',42,54,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,104),(20,'ru','Carentem frigore pluviaque densior pontus bracchia ardentior',NULL,'carentem_frigore_pluviaque_densior_pontus_bracchia_ardentior_20160218154257','<p>Carentem frigore pluviaque densior pontus bracchia ardentior. Posset: illi altae semina amphitrite auroram induit rectumque. Dominari rapidisque. Cornua ulla. Deerat nuper totidem egens bene iudicis! Dominari ipsa locum capacius terram caesa.</p>\n','<h1>Deorum nulli undae aliud vix</h1>\n\n<p>Carentem frigore pluviaque densior pontus bracchia ardentior. Posset: illi altae semina amphitrite auroram induit rectumque. Dominari rapidisque. Cornua ulla. Deerat nuper totidem egens bene iudicis! Dominari ipsa locum capacius terram caesa.</p>\n\n<h2>Caligine duris secuit nec qui</h2>\n\n<h3>Pontus scythiam recessit pluviaque coercuit</h3>\n\n<h4>Usu timebat nitidis proxima ille</h4>\n\n<p>Coeperunt calidis. Litora unda tonitrua pinus prima nabataeaque austro secuit aliud! Discordia illic sic formas inposuit mentes foret zephyro. Sectamque faecis media diremit coeperunt praebebat ante proxima fluminaque. Recessit sidera rectumque iudicis cingebant eodem. Caecoque proxima hominum declivia sinistra.</p>\n\n<ul>\n	<li>Deus sive nubes moderantum pronaque pace aeris adhuc quam triones locoque locum poena tuba</li>\n	<li>Nova toto austro capacius unus montibus aera regio terris inminet elementaque otia tuba locavit partim bracchia onus tanto aurea</li>\n	<li>Nullo ora ulla extendi madescit igni plagae ubi media ita nix pronaque onerosior sublime locis orbe vix terrarum septemque convexi cura faecis terras nullus</li>\n</ul>\n\n<p>Lacusque modo? Iners onus umentia frigore neu distinxit inclusum. Nisi subsidere! Neu possedit persidaque ventos certis surgere regna. Caelumque mundi fabricator. Terrarum inclusum coercuit aurea. Tanto undae ultima qui turba. Piscibus imagine orbem extendi sine nova inter caeca militis.</p>\n\n<ol>\n	<li>Membra solidumque praeter vix nullo di postquam animalibus sic locavit aeris alta metusque aethera ambitae locum mortales nulli hominum nubes mundum triones</li>\n	<li>Praeter deus faecis pondus carmen caelo eodem chaos: habitandae hominum naturae nullaque habentia quia bracchia</li>\n	<li>Coeptis animalia carmen manebat terris campoque nitidis abscidit his temperiemque fronde fuerant congestaque utramque pontus tonitrua tonitrua sponte mundi freta diremit</li>\n</ol>\n\n<p>Caligine mundi nullaque ipsa. Pontus caeleste retinebat moderantum quin facientes declivia. Tegit quae partim carmen supplex caesa pondere. Perpetuum cognati ille extendi fixo consistere media. Rapidisque locis est. Glomeravit titan rectumque quae consistere. Horrifer manebat egens lapidosos animalia seductaque cepit horrifer.</p>\n',NULL,NULL,'2016-02-18 15:41:00',NULL,'2016-02-18 15:42:57',1,3,0,0,NULL,'',68,NULL,1,'','','',44,0,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,NULL),(21,'ru','Terras forma est limitibus ora auroram',NULL,'terras_forma_est_limitibus_ora_auroram_20160218154401','<p>Terras forma est limitibus ora auroram. Turba rectumque vix formaeque consistere flexi. Sibi umentia dei carmen parte dixere mundi. Faecis iners illi corpora ambitae ponderibus? Ad ambitae rapidisque colebat aquae silvas erat: nubibus mixta.</p>\n','<h1>Contraria ventos emicuit pressa vultus</h1>\n\n<p>Terras forma est limitibus ora auroram. Turba rectumque vix formaeque consistere flexi. Sibi umentia dei carmen parte dixere mundi. Faecis iners illi corpora ambitae ponderibus? Ad ambitae rapidisque colebat aquae silvas erat: nubibus mixta.</p>\n\n<h2>Ardentior tum elementaque regna animalia</h2>\n\n<h3>Derecti nix satus indigestaque dicere</h3>\n\n<h4>Ad melioris ripis nec orba</h4>\n\n<p>Formas persidaque exemit. Persidaque horrifer. Numero videre sublime neu fulgura tuba terrenae volucres. Terras finxit septemque fronde. Zephyro proxima undae declivia fecit omni mundo. Montibus adsiduis adsiduis plagae tepescunt. Inclusum terris densior caeleste aera totidem lanient fixo solum.</p>\n\n<ul>\n	<li>Feras discordia nullaque fecit montes conversa vos ante lucis nondum ignotas hanc derecti fert</li>\n	<li>Mare aurea quoque lege ubi deducite viseret tellus quae media gravitate lucis calidis speciem ignotas dei dispositam duris ignotas tuba astra sole ad calidis</li>\n	<li>Coeperunt otia speciem densior secuit sunt fulminibus mixtam freta aetas pugnabant tegi haec vesper eodem pulsant videre regna</li>\n</ul>\n\n<p>Secuit poena fuerat longo sponte montes quicquam. Perveniunt egens zephyro undis opifex habentem valles. Rerum tanta ventis secuit orbem utramque faecis imagine! Principio locum opifex quisque. Occiduo sine et melioris liberioris declivia. Moderantum sidera fuerant postquam mixtam carentem!</p>\n\n<ol>\n	<li>Animalia caelumque aquae iunctarum levitate omni alta titan lapidosos inminet norant effervescere</li>\n	<li>Humanas ita illi suis nuper aequalis rectumque oppida undae persidaque omni omnia</li>\n	<li>Melior obliquis duris cetera natura regat ardentior qui prima nubes mutatas alto dedit diremit silvas levitate deerat nix tonitrua agitabilis</li>\n	<li>Mixta animal mollia ubi diverso ripis eodem egens premuntur sorbentur fecit rudis recens homini neu timebat secrevit in mixtam semina mutastis illas rerum</li>\n</ol>\n\n<p>Illi sunt caligine ipsa rerum nec nam persidaque dextra. Ante quoque obliquis. Sectamque sui fabricator fulgura. Conversa sinistra ponderibus sanctius rapidisque faecis zonae rerum. Ita orbem pulsant proxima ne divino facientes caligine. Tanta iners declivia erant tollere secuit invasit inposuit indigestaque.</p>\n',NULL,NULL,'2016-02-18 15:42:00','2019-02-25 12:51:37','2016-02-18 15:44:01',1,7,0,0,NULL,'',88,NULL,1,'','','',45,53,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,179),(22,'ru','Inminet nitidis timebat quinta prima neu et nubes',NULL,'inminet_nitidis_timebat_quinta_prima_neu_et_nubes_20160315151007','<p>Inminet nitidis timebat quinta prima neu et nubes. Concordi lucis elementaque. Securae caesa tonitrua. Pondere premuntur orbis mundum obstabatque metusque concordi aer. Manebat congestaque lucis mixta. Locoque tanta retinebat erat oppida caeca circumfluus natus? Quia congestaque non carentem tellus melioris satus cornua invasit!</p>\n','<p>Inminet nitidis timebat quinta prima neu et nubes. Concordi lucis elementaque. Securae caesa tonitrua. Pondere premuntur orbis mundum obstabatque metusque concordi aer. Manebat congestaque lucis mixta. Locoque tanta retinebat erat oppida caeca circumfluus natus? Quia congestaque non carentem tellus melioris satus cornua invasit!</p>\n\n<p>Litora ignea terris obliquis sidera plagae sibi aethere his? Nullaque tuti tractu tum levius vultus. Militis fratrum aere premuntur humanas litem pluvialibus oppida. Sinistra utque orbis diffundi subdita terrarum videre? Pontus spisso dixere orba omnia! Habentem fluminaque flamina dissaepserat recepta instabilis regat nulli.</p>\n\n<p>Austro erectos terrae legebantur sunt diversa. Cepit mollia certis boreas vis sata ante animus feras. Astra pro chaos: speciem totidem permisit. Supplex dicere ultima recessit altae usu possedit. Aestu cornua membra aethera. Ubi orbem manebat traxit. Quarum solidumque aequalis persidaque sanctius orbem aequalis.</p>\n',NULL,NULL,'2016-03-15 15:05:00','2016-03-15 15:10:07','2016-03-15 15:06:45',1,2,0,0,NULL,'',94,NULL,1,'','','',52,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,51,NULL),(23,'kz','Тестовый материал',NULL,'testovii_material_20190926150621','<p>Карикатура</p>\n','<p>Текст новости</p>\n',NULL,NULL,'2019-09-26 14:34:00','2019-11-05 11:02:53','2019-09-26 15:06:21',1,11,0,0,NULL,'',1,NULL,1,'','','',61,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,NULL),(24,'kz','Тестовый материал',NULL,'testovii_material_20190926150947','<p>Карикатура</p>\n','<p>Текст новости</p>\n',NULL,NULL,'2019-09-26 14:34:00',NULL,'2019-09-26 15:09:47',1,13,0,0,NULL,'',0,NULL,1,'','','',0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,57,NULL),(25,'ru','',NULL,'_20190926163755','','',NULL,NULL,'2019-09-26 16:36:00',NULL,'2019-09-26 16:37:55',1,NULL,0,0,NULL,'',0,NULL,1,'','','',0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,NULL),(26,'ru','',NULL,'_20190926163806','','',NULL,NULL,'2019-09-26 16:36:00',NULL,'2019-09-26 16:38:06',1,NULL,0,0,NULL,'',0,NULL,1,'','','',0,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,NULL),(27,'kz','«Төрт жүз» төрімізді былғамайды',NULL,'tort_zhuz_torimizdi_bilgamaidi_20191105104533','<p><strong><em>Теңгенің биржадағы күнделікті тербелісі тәуелсіз экономистер мен Ұлттық Банк арасындағы желідегі дискуссияның басты тақырыбына айналды. </em></strong></p>\n','<p>Қолданбалы экономиканы зерттеу орталығы сарапшылары &laquo;қарашада теңгенің долларға шаққандағы орташа бағамы 384-386 болады&raquo; дейді және оған макроэкономикалық кеңістіктегі екі құбылысты мысал етеді. Біріншісі &ndash; АҚШ-та қарашаның алғашқы күні шыққан еңбек жөніндегі статистика. Ауыл шаруашылығынан тыс секторларда еңбекке тартылған жандар саны қазан айында 128 мың адамға артқан. Бастапқы жоспар 89 мың адам болатын. Екінші фактор &ndash; Қытайдың жақсарған макростатистикасы.</p>\n\n<p>Қытайдағы іскерлік белсенділік көрсеткіші қазан айында 51,7 пунктті көрсетіп, &laquo;АҚШ-пен арадағы сауда соғысы Қытай экономикасын күйретеді&raquo; деген скептиктердің аузына құм құйған. &laquo;Осы екі фактор әлемдік экономиканың тежелу тәуекелін азайтты&raquo;, дейді орталықтың басқарушы директоры <a href=\"https://xn--80affa3aj0al.xn--80asehdb/#/im?p=@tengenomika\">Олжас Тілеуов.</a></p>\n\n<p>Қазақстан қаржыгерлер қауымдастығының <a href=\"http://www.afk.kz/kz/\">соңғы мәлімдемесінде</a>, керісінше, теңгенің бұдан әрі күшеюіне барлық жағдай жасалып отырғаны айтылған. Қауымдастық оның басты себебін Ұлттық Банктің бос ликвидті қаржыны нарықтан алып тастап отыратын тәжірибесімен байланыстырады.</p>\n\n<p>&laquo;Бұл жағдайда Ұлттық Банктің қысқа мерзімді қарыз қағаздарын шығарудағы әрекетін атап өту керек. Өткен аптада нарықтан алынған қаржы көлемі 3,4 триллион теңгеден 3,8 триллион теңгеге жетіп, бұл соңғы 3 айдағы ең үлкен көрсеткіш болды. Айналымдағы теңгенің аздығы алыпсатарлықты азайтып, ұлттық валютаның позициясын нығайтуға септігін тигізеді&raquo;, - делінген мәлімдемеде. &nbsp;&nbsp;&nbsp;</p>\n\n<p>Нарықта артық теңге көбейгенде және бұл ұлттық валюта бағамын құлдыратып, инфляцияны жеделдете бастағанда Ұлттық Банк &laquo;залалсыздандыру&raquo; операциясын іске қосып жүр. Бұл тәжірибе соңғы 4-5 жылда жиі қолданылады. Сондықтан қазір инфляция баяғыдай теңгенің көптігінен емес, азық-түліктің қымбаттауынан болады. Бұл &laquo;дертке&raquo; қарсы Ұлттық Банк әзірге дәрілік рецепт таба алмай отыр.</p>\n\n<p><strong>Болжамның да болжамы бар&nbsp; </strong></p>\n\n<p>Жыл басында &laquo;төбесінде тесігі бар&raquo; біраз қаржыгер &laquo;доллар 400 теңгеден асады&raquo; деген болжам жасаған. Нақты жағдайға қарасақ, бұл болжамның болмайтын түрі бар. &nbsp;</p>\n\n<p>Ендеше, болжамнан қателескен сарапшылардың рейтингін түзіп жіберу қиын емес. Егекр солай етсек, бірінші орынға Astana Best Consulting Group экономисі Арман Байғановты қою керек. Ол &laquo;теңге тек қана АҚШ бюджетінің қабылданбай тұрғандығынан аман отыр, жылдың ортасынан кейін <a href=\"https://365info.kz/2019/01/dollar-za-400-tenge-vo-vtoroj-polovine-2019-go-ekonomist\">доллар 400 теңгеден асады</a>&raquo; деп сенімді түрде айтқан.</p>\n\n<p>Былтыр қыркүйекте баспасөз-маслихатын өткізіп, онда &laquo;<a href=\"https://kursiv.kz/news/finansy/2018-09/ekspert-kurs-400-tenge-za-dollar-my-uvidim-v-sleduyuschem-godu\">2019 жылы доллар 400 теңгеден асып жығылады</a>&raquo; деген &laquo;Альпари&raquo; компаниясының сараптама департаменті директоры Александр Разуваевтың еншісі &ndash; екінші орын.</p>\n\n<p>Сарапшы Ерлан Ибрагим алдағы екі әріптесі сияқты теңгені сенімді түрде 400-дің шекарасынан асырып жібермесе де, &laquo;жетіп қалар-ау&raquo; деген біртүрлі болжам айтқан еді. Тіпті ол теңгенің құлдырауын жеделдетіп, 2019 жылдың тамыз-қыркүйек айларында &laquo;жетелеп&raquo; әкелген.</p>\n\n<p>Былтыр &laquo;доллардың <a href=\"https://ustinka.kz/kz/kazakhstan/economy/33512.html?mobile=Y\">шын бағасы 420 теңге</a>&raquo; деп асыра сілтеген Денис Кривошеевті бұл рейтингке кіргізбей-ақ қойсақ та өкпелемес...&nbsp;</p>\n\n<p>&laquo;Ұлттық Банк теңгені тым құлата қоймайды&raquo; деген Олжас Құдайбергенов, Айдархан Құсайынов сынды сарапшылардың аты озып тұр.</p>\n\n<p>Nege.kz порталының экономикалық шолушылар тобы жаңа жылда ұлттық валютаның долларға шаққандағы құны 384-388 теңге дәлізінде болады сенімде. Бұған дәлеліміз бар. Дәлелге жүгінбес бұрын осы айда қор биржасында теңгенің қалай-қалай құбылатынын тағы бір қызықтап алған жөн деп шештік.</p>\n\n<p><strong>Айбар Олжаев, Nege.kz</strong></p>\n',NULL,NULL,'2019-11-05 10:41:00','2019-11-05 10:49:59','2019-11-05 10:45:33',1,3,1,0,NULL,'',1,NULL,1,'','','',59,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,NULL),(28,'kz','Наразылар мен \"разылар\"',NULL,'narazilar_men_razilar_20191105110025','<p><strong>Ғалым Смағұл, <em>Nege.kz</em></strong></p>\n','',NULL,NULL,'2019-11-05 10:55:00','2019-11-05 11:02:53','2019-11-05 11:00:25',1,13,1,0,NULL,'',8,NULL,1,'','','',60,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,NULL),(29,'kz','\"Әке, ішпеші!\"',NULL,'ake_ishpeshi_20191105110825','<p><strong>Ғалым Смағұл, <em>Nege.kz</em></strong></p>\n','',NULL,NULL,'2019-11-05 11:04:00','2019-11-05 11:11:53','2019-11-05 11:08:25',1,13,1,0,NULL,'',4,NULL,1,'','','',62,NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,0,NULL);
