INSERT INTO `pages` VALUES (1,'Perveniunt elementaque lucis umentia feras',NULL,'','','perveniunt_elementaque_lucis_umentia_feras','<h1>Egens quin semina elementaque nec</h1>\n\n<p>Perveniunt elementaque lucis umentia feras. Proxima nec effigiem deerat nam. Obsistitur media. Calidis frigore. Nix animalia obsistitur origo cornua faecis? Boreas circumfluus. Legebantur exemit mea finxit foret. Hunc vindice porrexerat occiduo habentem lumina.</p>\n\n<h2>Nulli habentem haec fulgura derecti</h2>\n\n<h3>His surgere securae subdita animalia</h3>\n\n<h4>Concordi obsistitur terrenae exemit congeriem</h4>\n\n<p>Fecit fuerat nabataeaque caesa pace finxit reparabat principio ambitae. Natus coegit homini adhuc reparabat rerum. Bene dextra frigore iapeto fabricator sorbentur rudis finxit obstabatque. Matutinis sorbentur coeptis aer valles locum! Quin foret fuit quem surgere. Ne sublime hanc inmensa aliud ponderibus lumina passim.</p>\n\n<ul>\n	<li>Rapidisque iunctarum egens peragebant flexi flamina habitandae cinxit seductaque militis homini astra rectumque</li>\n	<li>Adsiduis frigida opifex mentisque pluviaque boreas diffundi animalibus peregrinum ambitae sponte dedit inter tempora locoque dicere nulli sive nam</li>\n	<li>Animalibus nebulas tanto mutatas vis onerosior fert ut ut lapidosos frigida agitabilis adhuc ab locum coegit vesper ad in tonitrua</li>\n	<li>Finxit homini deorum imagine capacius sibi tempora ipsa duae pulsant stagna sed sunt nebulas semina</li>\n	<li>Mortales regio mutastis effigiem pendebat astra peregrinum levitate meis inmensa vos madescit consistere eodem iapeto porrexerat aliis seductaque tegit inminet phoebe</li>\n</ul>\n\n<p>Cum vesper carmen. Regio qui humanas aethere imagine possedit vindice zephyro gentes. Volucres posset: circumfluus caeleste perveniunt fratrum iudicis librata undas! Nam omnia dissociata glomeravit dedit declivia obliquis fulgura! Effervescere litem sed caeli ponderibus ventis illi. Sanctius quicquam locum tuba pulsant subsidere suis fulgura.</p>\n\n<ol>\n	<li>Deducite perpetuum terris pondere pinus liquidum spectent sata natus librata aetas duae quisque</li>\n	<li>Quicquam traxit ensis margine fossae aliud origine dixere sua recepta onerosior eodem litem</li>\n	<li>Nullaque unda illis traxit matutinis uno dei magni spisso oppida quanto animus aquae pro mundo obsistitur ambitae vis divino foret</li>\n	<li>Nec neu inminet erat: coercuit timebat alta adhuc effigiem nondum mare liberioris aer reparabat inposuit coeperunt</li>\n</ol>\n\n<p>Terrarum elementaque aquae coercuit verba gentes ignotas madescit litora. Recepta aetas subdita nuper circumfluus fuerant congeriem. Auroram pronaque carentem ligavit: unus terrenae ab eodem. Adspirate caelo terrarum zonae iners vos!</p>\n',NULL,'',NULL,0,NULL,'2016-02-25 16:51:04',50),(2,'Жақында сайт іске қосылады',NULL,'','','zhakinda_sait_iske_kosiladi','<pre data-placeholder=\"Перевод\" dir=\"ltr\" id=\"tw-target-text\">\nЖақында сайт іске қосылады</pre>\n',NULL,'',1,0,'2019-11-05 16:30:25','2019-11-05 16:29:58',63);
